webpackJsonp([61707071062113],{7708:function(e,o){e.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2006/10/google_reunification_logo.gif" alt="Google Reunification Logo" /></p>\n<p>The German version of Google at google.de has a nice German flag logo to celebrate the <a href="http://en.wikipedia.org/wiki/German_Unity_Day">Day of German Unity holiday</a> today (as pointed out by <a href="http://www.sichelputzer.de/2006/10/03/das-patriotische-google/">Telagon Sichelputzer</a>). However, if you have English set as your language, you see only the normal Google Deutschland logo.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2006/10/google_deutschland.jpg" alt="Google Deutschland" /></p>\n<ul>\n<li><a href="http://www.google.de/de">google.de in German</a></li>\n<li><a href="http://www.google.de/en">google.de in English</a></li>\n</ul>\n<p>The main site google.com doesn\'t show a special logo in either language.</p>\n<p>Strange. Is this a mistake, or does Google Deutschland think celebrating German reunification is only for German speakers?</p>',fields:{title:"Google Patriotism",date:"03 Oct 2006",url:"https://papascott.de/2006-10-03-google-patriotism/"}}},pathContext:{slug:"/2006-10-03-google-patriotism/",prev:{fields:{title:"Hans, Are We the Baddies?",date:"02 Oct 2006",slug:"/2006-10-02-hans-are-we-the-baddies/"}},next:{fields:{title:"Comeback",date:"08 Oct 2006",slug:"/2006-10-08-comeback/"}}}}}});
//# sourceMappingURL=path---2006-10-03-google-patriotism-452f84a13d535b60a67b.js.map